The Maw is an action-adventure video game developed by independent developer Twisted Pixel Games [2]. It was released on Xbox Live Arcade on January 21, 2009, and for Microsoft Windows on March 9, 2009. It became available via Steam on March 10, 2009.[3]. The game revolves around a blue alien by the name of Frank, and a purple blob named Maw, that he leads around the game world, feeding and evolving.

The game won the 2008 Audience Choice award at PAX10[4], and is currently a finalist at the Independent Games Festival 2009 [5]
